import React from 'react';
import './Admin.css';

const Admin = () => {
    return (
      <div>
        <h1>Admin Site</h1>
        <ResponseRow professor="antonella"/>
        <ResponseRow professor="golitsyn"/>
        <ResponseRow professor="shiff"/>
        <ResponseRow professor="hickey"/>
      </div>
    );
  }

function ResponseRow(props) {
  return (
    <div class='row'>
      <div class="col-lg-6 col-md-6 col-sm-6 response-row">{props.professor}</div>
      <div class="col-lg-6 col-md-6 col-sm-6 response-row">course name</div>
    </div>
  );
}
export default Admin;
